import React from "react";

function Dashboard() {
  return (
    <div
      style={{
        height: "40vh",
        width: "80vw",
        backgroundColor: "green",
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
      }}
    >
      {/* Content of the Dashboard */}
      <div style={{ height: "30vh", width: "30vw", backgroundColor: "blue" }}>
        {/* Your actual content goes here */}
      </div>
    </div>
  );
}

export default Dashboard;
